import personService from '../services/persons'



const Clear = (props) => {
  
  const deleteAll = () => {
    personService
    .deletePerson(1)
  }
  deleteAll();




  return (
    <>
    <button type="submit" onClick = {Clear}>Clear phonebook!</button>
    </>
  )
}

export default Clear
